def longest_word(letters):
    # _words = [sorted(word) for word in words]

    ans = []

    for word in words:
        _word_clone = word

        for letter in letters:
            if letter in _word_clone:
                _word_clone = ''.join(_word_clone.split(letter, 1))

        if _word_clone == "":
            ans.append(word)

    if ans == []:
        return None
    else:
        longest = len(max(ans, key=len))

        return list(filter(lambda x: len(x) == longest, ans))


